import './style.css';
import React from 'react';
import NavbarRB from 'react-bootstrap/Navbar';
import Form from 'react-bootstrap/Form';
import Nav from 'react-bootstrap/Nav';
import NavDropdown from 'react-bootstrap/NavDropdown';
import FormControl from 'react-bootstrap/FormControl';
import Button from 'react-bootstrap/Button';

class Navbar extends React.Component{

	render(){
		console.log("js is enabled")
		return (
			<div>
			<NavbarRB variant="dark" sticky="top">
				<NavbarRB.Brand>Checkout Helper</NavbarRB.Brand>
				<Button>Add Item</Button>
				<Button>Add A Randomlized Item</Button>
				<Button>Change Province</Button>
			</NavbarRB>

			<NavbarRB bg="light" expand="lg">
			  <NavbarRB.Brand className="navbarLogo" href="">
				<img 
			        alt=""
			        src="https://cdn.clipart.email/d8a63873616061abe7766d804101fd26_online-shopping-cart-logo-png-png-image_256-256.png"
			        className="d-inline-block align-top"
			      />{' '}
			      Checkout App
			    </NavbarRB.Brand>
			  <NavbarRB.Toggle aria-controls="basic-navbar-nav" />
			  <NavbarRB.Collapse id="basic-navbar-nav">
			    <Nav className="mr-auto">
			      <Nav.Link href="#home">Home</Nav.Link>
			      <Nav.Link href="#link">Link</Nav.Link>
			      <NavDropdown title="Dropdown" id="basic-nav-dropdown">
			        <NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item>
			        <NavDropdown.Item href="#action/3.2">Another action</NavDropdown.Item>
			        <NavDropdown.Item href="#action/3.3">Something</NavDropdown.Item>
			        <NavDropdown.Divider />
			        <NavDropdown.Item href="#action/3.4">Separated link</NavDropdown.Item>
			      </NavDropdown>
			    </Nav>
			    <Form inline>
			      <FormControl type="text" placeholder="Search" className="mr-sm-2" />
			      <Button variant="outline-success">Search</Button>
			    </Form>
			  </NavbarRB.Collapse>
			</NavbarRB>
			</div>

		)
	}
}

export default Navbar;
